import React from 'react';
import { Route, Routes, Link } from 'react-router-dom';
import './Nav.css';
import Veg from './Veg';
import Tiffins from './Tiffins';
import AboutUs from './About';
import Home from './Home'; // Import the Home component
import Cart from './Cart';


function App() {
  return (
    <div>
      <nav>
        <ul>
        {/* <img src="./images/logo1.jpg" alt="Logo" /> */}

        <li>
            <Link to="/about-us">About Us</Link>
          </li>
          <li>
            <Link to="/nonveg">NonVeg</Link>
          </li>
          <li>
            <Link to="/veg">Veg</Link>
          </li>
          <li>
            <Link to="/tiffins">Tiffins</Link>
          </li>
          
          <li>
            <Link to="/Add to cart">Cart</Link>
          </li>
        </ul>
      </nav>

      <Routes>
        {/* Ensure the component names match the imported components */}
        <Route path="/about-us" element={<AboutUs />} />
        <Route path="/nonveg" element={<Home />} />
        <Route path="/veg" element={<Veg />} />
        <Route path="/tiffins" element={<Tiffins />} />
        <Route path="/add-to-cart" element={<Cart />} />

      </Routes>
    </div>
  );
}

export default App;
